cd ~/github/GradientDescentExample/hf = figure (); data = csvread("data.csv");printf(typeinfo(data));b = 0.0889365199374; m = 1.47774408519;x = [20:80];y = x * m + b;plot(data(:, 1), data(:,2), ".", x, y);hold on;xlabel ("X");ylabel ("Y");print (hf, "images/dots.png", "-dpng");#print (hf, "images/dots.svg", "-dsvg");